    structPtr = (Exi_ISO_AuthorizationReqType*)(&DecWsPtr->OutputData.StoragePtr[DecWsPtr->OutputData.StorageOffset]); /* PRQA S 0310 */  /*  MD_Exi_11.4 */
    Exi_ClearMemory(&DecWsPtr->OutputData.StoragePtr[DecWsPtr->OutputData.StorageOffset], sizeof(*structPtr));
