  Exi_CheckInternalDetErrorReturnVoid((0 != DecWsPtr->OutputData.StorageLen), EXI_DECODER_INSTANCE_ID, EXI_API_ID_DECODE_ISO_SERVICE_PARAMETER_LIST, EXI_E_INV_PARAM);
  Exi_CheckInternalDetErrorReturnVoid((DecWsPtr->OutputData.StorageOffset < DecWsPtr->OutputData.StorageLen), EXI_DECODER_INSTANCE_ID, EXI_API_ID_DECODE_ISO_SERVICE_PARAMETER_LIST, EXI_E_INV_PARAM);
